MOTHER/MOEDER has been officially selected at (Academy Award Qualifying) CLERMONT-FERRAND film festival @clermontisff. I am so very thankful and proud that this film is slowly finding its home, and subsequently its festival audience - particularly at @clermontisff. It was a tremendous labor of love - shot 3 months before the Russian Invasion of Ukraine, in Nov 2021. I sat on the footage for a while as I couldn’t watch it for months, given how fresh the reality of the unfolding events that started in an unprecedented way on 24th of Feb in Ukraine were - the seeds of which are echoed in my story which is set years prior: in 2014. My producer @linnikzhuravliov encouraged me to finish, and I’m glad I did and that it’s finally finding its place in the world. More details to follow on screening times and dates. 

